import Link from 'next/link'


const Navigation = () => {
    return(
        <ul>
            <li>
                <Link href='/'><a>Home</a></Link>
            </li>
            <li>
                <Link href='/character'><a>Personajes</a></Link>
            </li>
        </ul>
    )
}
export default Navigation;
